class Home extends React.Component{

	render(){
		return(
  <div class="home-container">
    <Card title="This is home" bordered={false} style={{ width: 300 }}>
      <p>Card content</p>
      <p>Card content</p>
      <p>Card content</p>
    </Card>
  </div>);
	}
}


export default Home;
